import LoaiSanPham from "./loai_san_pham";

function Trangchu(){
  const dsLoaiSanPham=[
    {
      'ten':'loại Sản Phẩm 1',
      'ds_san_pham':[
        {
          'hinh_anh':'./1.jpg',
          'ten':'Sản Phẩm 1',
          'gia':'1000',
        },
        {
          'hinh_anh':'./1.jpg',
          'ten':'Sản Phẩm 2',
          'gia':'1000',
        },
      ]
    },
    {
      'ten':'Loại Sản Phẩm 2',
      'ds_san_pham':[
        {
          'hinh_anh':'1.jpg',
          'ten':'Sản Phẩm 3',
          'gia':'1000',
        },
        {
          'hinh_anh':'1.jpg',
          'ten':'Sản Phẩm 4',
          'gia':'1000',
        },
      ]
      
      
    },
    {
      'ten':'Loại Sản Phẩm 3',
      'ds_san_pham':[
        {
          'hinh_anh':'1.jpg',
          'ten':'Sản Phẩm 5',
          'gia':'1000',
        },
        {
          'hinh_anh':'1.jpg',
          'ten':'Sản Phẩm 6',
          'gia':'1000',
        },
      ]
      
      
    }
  ];


  const listLoaiSanPham=dsLoaiSanPham.map(function(item){
    return(

      <LoaiSanPham data ={item}/>
    );
  });
  return(
    <>
     <Banner/>
    <Hearder/>

    <Footer/>
    {listLoaiSanPham}</>
  )
};


export default Trangchu;
